// SPDX-License-Identifier: MIT

pragma solidity ^0.6.0;

import "../node_modules/@openzeppelin/contracts/math/SafeMath.sol";

contract FlightSuretyData {
    using SafeMath for uint256;

    /********************************************************************************************/
    /*                                       DATA VARIABLES                                     */
    /********************************************************************************************/

    address private contractOwner;                                      // Account used to deploy contract
    address private authorizedContract;

    // Blocks all state changes throughout the contract if false


    uint numberOfApproved;

    struct Airline {
        string name;
        // 0 : does not exist
        // 1 waiting for approval
        // 2 approved
        // 3 funded (10 ether payed)
        // 9 blocked
        uint status;
    }

    //
    // Multiparty Consensus Approval Vote
    //

    struct AirlineApprovalVote {
        address airlineAddress;
        // 0 not voted
        // 1 approve
        // 2 disapprove
        uint vote;
    }

    struct AirlineApproval {
        mapping(uint => AirlineApprovalVote) airlineApprovalVoteIndex;
        uint length;
    }

    uint private consensusThreshold = 3;
    mapping(uint => address) private airlineIndex;
    uint private airlineIndexLength = 0;
    mapping(address => Airline) private airlineData;
    mapping(address => AirlineApproval) private address2airlineApproval;




    /********************************************************************************************/
    /*                                       EVENT DEFINITIONS                                  */
    /********************************************************************************************/

    event Registered(address airlineAddress, string airlineName, uint status);
    event DataConsole(uint level, string info, uint int0, uint int1, uint int2);


    /**
    * @dev Constructor
    *      The deploying account becomes contractOwner
    */
    constructor
    (
    )
    public
    {
        contractOwner = msg.sender;
    }

    /********************************************************************************************/
    /*                                       FUNCTION MODIFIERS                                 */
    /********************************************************************************************/



    /**
    * @dev Modifier that requires the "ContractOwner" account to be the function caller
    */
    modifier requireContractOwner()
    {
        require(msg.sender == contractOwner, "Caller is not contract owner");
        _;
    }

    modifier requireAuthorizedCaller()
    {
        require(msg.sender == authorizedContract, "Caller is not authorized contract");
        _;
    }



    /********************************************************************************************/
    /*                                       UTILITY FUNCTIONS                                  */
    /********************************************************************************************/






    function authorizeCaller
    (
        address _contract
    )
    external
    requireContractOwner
    {
        authorizedContract = _contract;
    }


    /********************************************************************************************/
    /*                                     SMART CONTRACT FUNCTIONS                             */
    /********************************************************************************************/


    function registrationNeedsVoting() public requireAuthorizedCaller view returns (bool){
        return !(consensusThreshold > airlineIndexLength);
    }

    function registerAirline
    (
        address _airlineAddress, string memory _airlineName
    )
    requireAuthorizedCaller
    external
    {

        if (_airlineAddress == address(0)) {
            return;
        }

        require(!isRegistered(_airlineAddress), 'Already_Registered');
        if (!registrationNeedsVoting()) {
            airlineData[_airlineAddress] = Airline(_airlineName, 2);
        } else {
            emit DataConsole(1000, 'Approval needed: ', 0, 0, 0);
            string memory airlineName = airlineData[_airlineAddress].name;
            emit DataConsole(1000, airlineName, 0, 0, 0);
            address2airlineApproval[_airlineAddress] = AirlineApproval(0);
            AirlineApproval storage airlineApproval = address2airlineApproval[_airlineAddress];
            uint index = 0;
            for (uint i = 0; i < airlineIndexLength; i++) {
                address addressV = airlineIndex[i];
                Airline storage airlineV = airlineData[addressV];
                if (airlineV.status > 1) {
                    airlineApproval.airlineApprovalVoteIndex[index] = AirlineApprovalVote(addressV, 0);
                    index += 1;
                }
            }
            airlineData[_airlineAddress] = Airline(_airlineName, 1);

            uint nrOfVoters = address2airlineApproval[_airlineAddress].length;
            emit DataConsole(1000, 'Nr of voters: ', nrOfVoters, 0, 0);
        }
        airlineIndex[airlineIndexLength] = _airlineAddress;
        airlineIndexLength += 1;
        Airline memory airline = airlineData[_airlineAddress];
        emit Registered(_airlineAddress, airline.name, airline.status);
    }

    function isRegistered(address airline) public view returns (bool)
    {
        return airlineData[airline].status > 1;
    }

    function isAirline(address airline) public view returns (bool)
    {
        return airlineData[airline].status > 0;
    }

    function numberOfAirlines() public view returns (uint)
    {
        return airlineIndexLength;
    }


    function getConsensusThreshold() public view returns (uint)
    {
        return consensusThreshold;
    }


    function getAirline(uint index) public view returns (string memory name, uint status)
    {
        require(index < airlineIndexLength, 'Wrong_Index');
        Airline memory a = airlineData[airlineIndex[index]];
        return (a.name, a.status);
    }

    function getVotingResults(uint index) public view returns (uint yes, uint no, uint open, uint voters)
    {
        require(index < airlineIndexLength, 'Wrong_Index');
        AirlineApproval storage a = address2airlineApproval[airlineIndex[index]];
        yes = 0;
        no = 0;
        open = 0;
        voters = a.length;
        for (uint i = 0; i < voters; i++) {
            if (a.airlineApprovalVoteIndex[i].vote == 0) {
                open += 1;
            }
            if (a.airlineApprovalVoteIndex[i].vote == 1) {
                yes += 1;
            }
            if (a.airlineApprovalVoteIndex[i].vote == 2) {
                no += 1;
            }
        }
        return (yes, no, open, voters);
    }

    function voteOnAirline(address _airlineAddress, address _voterAddress, uint _vote) public requireAuthorizedCaller {
        require(_vote == 1 || _vote == 2, 'Vote_should_be_1_or_2');
        require(_airlineAddress != address(0), 'Empty_airlineAddress');
        require(_voterAddress != address(0), 'Empty_voterAddress');
        Airline memory airline = airlineData[_airlineAddress];
        require(airline.status == 1, 'Airline_status_not_1');
        AirlineApproval storage airlineApproval = address2airlineApproval[_airlineAddress];
        uint i = 0;
        uint yesVotes = 0;

        for (i = 0; i < airlineApproval.length; i++) {
            AirlineApprovalVote storage airlineApprovalVote = airlineApproval.airlineApprovalVoteIndex[i];
            if (airlineApprovalVote.airlineAddress == _airlineAddress) {
                airlineApprovalVote.vote = _vote;
            }
            if (airlineApprovalVote.vote == 1) {
                yesVotes += 1;
            }
        }
        if (yesVotes >= airlineApproval.length / 2) {
            airlineData[_airlineAddress].status = 2;
        }
    }

    //    ***
    //    INSURANCE SECTION
    //    ***

    uint paybackRatioPercentage = 150;

    struct FlightData {
        address airline;
        string flight;
        uint256 timestamp;
        mapping(address => uint) insurances;
        // 1 ok (initial)
        // 2 pay outs
        uint status;
        uint totalSum;
    }

    mapping(bytes32 => FlightData) flightData;
    bytes32[] flightKeys;


    /**
     * @dev Buy insurance for a flight
     *
     */
    function buyInsurance
    (
        address airline,
        string memory flight,
        uint256 timestamp,
        address insuree,
        uint amount
    )
    external
    requireAuthorizedCaller
    payable
    {

        bytes32 flightKey = getFlightKey(airline, flight, timestamp);
        require(amount > 0, 'Amount_needs_to_be_greater_than_0');
        require(amount > 0, 'Amount_needs_to_be_greater_than_0');
        require(flightData[flightKey].airline != address(0), 'Flight_does_no_exist');
        require(flightData[flightKey].insurances[insuree] == 0, 'Insuree_already_exists');


        address(this).transfer(amount);
        flightData[flightKey].insurances[insuree] = amount;

    }

    /**
     *  @dev Credits payouts to insurees
    */
    function creditInsurees
    (
        address airline,
        string memory flight,
        uint256 timestamp
    )
    external
    requireAuthorizedCaller
    {
        bytes32 flightKey = getFlightKey(airline, flight, timestamp);
        require(flightData[flightKey].airline != address(0), 'Flight_does_no_exist');
        require(flightData[flightKey].status == 1, 'FlightData_wrong_status');
        flightData[flightKey].status = 2;
    }


    /**
     *  @dev Transfers eligible payout funds to insuree
     *
    */
    function pay
    (
        address airline,
        string memory flight,
        uint256 timestamp,
        address payable insuree
    )
    external
    payable
    {

        bytes32 flightKey = getFlightKey(airline, flight, timestamp);
        require(flightData[flightKey].airline != address(0), 'Flight_does_no_exist');
        require(flightData[flightKey].insurances[insuree] > 0, 'Insuree_does_no_exist_or_payout_done');
        require(flightData[flightKey].status  != 2, 'No_payout');
        insuree.transfer(flightData[flightKey].insurances[insuree]);
    }

    /**
     * @dev Initial funding for the insurance. Unless there are too many delayed flights
     *      resulting in insurance payouts, the contract should be self-sustaining
     *
     */
    function fund
    (
    )
    public
    payable
    {
        Airline memory airline = airlineData[msg.sender];
        require(airline.status != 0, 'Airline_not_registered');
        require(airline.status != 3, 'Already_funded');
        require(airline.status == 2, 'Unknown_status');
        require(msg.value >= 10, 'Not_enough_fund');
        address(this).transfer(10);
        uint amountToReturn = msg.value.sub(10);
        msg.sender.transfer(amountToReturn);
        airlineData[msg.sender].status = 3;
    }

    function getFlightKey
    (
        address airline,
        string memory flight,
        uint256 timestamp
    )
    pure
    internal
    returns (bytes32)
    {
        return keccak256(abi.encodePacked(airline, flight, timestamp));
    }

    /**
    * @dev Fallback function for funding smart contract.
    *
    */
    fallback()
    external
    payable
    {
        fund();
    }

    receive()
    external
    payable
    {
        fund();
    }


}
